-- Volcando estructura para función planilla.fn_correlativo
DROP FUNCTION IF EXISTS `fn_correlativo`;
DELIMITER //
CREATE FUNCTION `fn_correlativo`(`prm` varchar(50)) RETURNS int(11)
BEGIN

declare mult_nro int;
select COALESCE(ult_nro,0) into mult_nro from tcorrelativos 
where tabla like concat(prm,'%') ;

IF mult_nro = 0 THEN
SET mult_nro = 1; 
ELSE
SET mult_nro = mult_nro +1;
END IF;

UPDATE tcorrelativos SET ult_nro = mult_nro
WHERE tabla like concat(prm,'%') ;


RETURN mult_nro;
END//
DELIMITER ;


